import React from 'react';
import Navbar from "./Components/Navbar";

export default class Error extends React.Component {
   render() {
    return (
        <div style={{background: "gray"}}>
        <Navbar />
        <section id="error">
            <h2 className="text-center">404 Error: Page Not Found</h2>
        </section>
        </div>
    )
}
}
